INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (119701, "2022/01/31 12:00:00", 0, "シェフィ", 119701, 0, 0, 0, 0.0, 4, 0, 4, 0, 0, 0, 0, "", 3, "しぇふぃ", 0, 0, 0, 0, "2030/12/31 15:00:00");
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (119901, "2023/12/22 12:00:00", 0, "ミヤコ（クリスマス）", 119901, 119901, 119901, 1, 2.17, 1, 14, 1, 0, 450, 0, 1, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 3, "みやこ", 0, 0, 302, 0, "2023/12/27 11:59:59");
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (120001, "2024/03/22 12:00:00", 0, "シズル（ノワール）", 120001, 120001, 120001, 1, 2.375, 5, 6, 5, 0, 450, 0, 1, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 3, "しずる", 0, 0, 190, 0, "2024/03/28 11:59:59");
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (120101, "2015/04/01 15:00:00", 0, "イオ（ノワール）", 120101, 0, 0, 0, 0.0, 7, 0, 7, 0, 0, 0, 0, "", 3, "いお", 0, 0, 0, 0, "2030/12/31 15:00:00");
